import React, { Component } from 'react';

const NavBar = props => {
    return (
        <nav class="navbar navbar-light bg-light">
        <div class="container-fluid">
          <a class="navbar-brand" href="#">
              Navbar 
          <span className="badge badge-pill badge-secondary m-2">
              {props.totalCounters}
              </span>
          </a>
        </div>
      </nav>);
};

 
export default NavBar;
